import React from "react";

function Hero() {
  return (
    <div
      className="bg-local text-basefont"
      style={{ backgroundImage: url(`https://images.unsplash.com/photo-1517694712202-14dd9538aa97?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8M3x8Y29tcHV0ZXJ8ZW58MHx8MHx8&auto=format&fit=crop&w=500&q=60`) }}
    >
      <div className="mt-24 flex h-screen flex-col items-center">
        <p className="text-2xl font-bold uppercase text-primary">Growing Together</p>
        <h1 className="font-bold">Grow With Data</h1>
        <div>
          <p className="font-bold">Fast, Flexible and Great</p>
        </div>
      </div>
    </div>
  );
}

export default Hero;
